DROP PROCEDURE IF EXISTS `proc_insert_coa`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_insert_coa`(IN `int_parent_id` INT, IN `str_acc_name` VARCHAR(250), IN `str_nomor_umum` VARCHAR(250))
BEGIN
	#Routine body goes here...
	DECLARE max_ujung INT;
	DECLARE acc_number_parent, tipe_parent, acc_number_baru VARCHAR(250);

	# Mencari ujung terakhir
	SELECT COALESCE(MAX(CAST(SUBSTRING_INDEX(acc_number,'.',-1) AS UNSIGNED)), 0) FROM itbl_main_coa WHERE parent_id = int_parent_id INTO max_ujung;

	# Mencari acc_number parent
	SELECT acc_number, tipe FROM itbl_main_coa WHERE id = int_parent_id INTO acc_number_parent, tipe_parent;

	# Set acc_number dia
	SET acc_number_baru = CONCAT(acc_number_parent,'.',(max_ujung + 1));

	VALUES(int_parent_id, acc_number_baru, str_acc_name, tipe_parent, str_nomor_umum, 0);
	
END$$

