DROP FUNCTION IF EXISTS `func_level_coa`$$
CREATE DEFINER=`root`@`localhost` FUNCTION `func_level_coa`(`int_id_coa` INT) RETURNS int(11)
BEGIN
	#Routine body goes here...
	DECLARE int_pjg_kar, int_jlh_titik INT;
	DECLARE str_acc_number VARCHAR(100);
	DECLARE i INT DEFAULT 1;

	SELECT acc_number FROM itbl_main_coa WHERE id = int_id_coa INTO str_acc_number;
	SET int_pjg_kar = LENGTH(str_acc_number);

	SET int_jlh_titik = 0;
	WHILE i<=int_pjg_kar DO
		BEGIN
			IF SUBSTR(str_acc_number,i,1) = '.' THEN
				SET int_jlh_titik = int_jlh_titik + 1;
			END IF;
		END;
		SET i = i + 1;
	END WHILE;
	
	RETURN int_jlh_titik;
END$$

DROP FUNCTION IF EXISTS `func_realisasi_pagu`$$
CREATE DEFINER=`root`@`localhost` FUNCTION `func_realisasi_pagu`(`dt_dari` DATETIME, `dt_sampai` DATETIME, `int_id_coa` INT) RETURNS double
BEGIN
	#Routine body goes here...
	DECLARE total INT;

	SELECT
		COALESCE(SUM(b.nilai), 0) into total
	FROM
		itbl_apps_spp_spm a
		LEFT JOIN itbl_apps_coa_spp_spm b ON a.id = b.id_spp_spm
		LEFT JOIN itbl_main_coa c ON b.id_coa_pagu = c.id
	WHERE
		a.tanggal BETWEEN dt_dari AND dt_sampai
		AND c.acc_number LIKE CONCAT((SELECT acc_number FROM vw_coa WHERE id = int_id_coa),'%');

	RETURN total;
END$$

DROP FUNCTION IF EXISTS `func_total_belanja_barang`$$
CREATE DEFINER=`root`@`localhost` FUNCTION `func_total_belanja_barang`(`int_id_belanja_barang` INT) RETURNS double
BEGIN
	#Routine body goes here...
	DECLARE dbl_total, dbl_jumlah, dbl_ppn, dbl_pph, dbl_normatif DOUBLE;

	# Hitung Belanja Barang nya
	BEGIN
		DECLARE v_finished INT;
		DECLARE cursor_data CURSOR FOR
			SELECT
				(datanya.qty * datanya.harga_satuan) AS jumlah,
				SUM(datanya.besar_ppn) AS ppn, SUM(datanya.besar_pph) AS pph
			FROM
				(
					SELECT
						a.*, b.keterangan AS jenis_pajak,
						COALESCE(ppn.besar, 0) AS persen_ppn, COALESCE(pph.besar, 0) AS persen_pph,
						@ppn := CASE
							WHEN a.ppn = 1 THEN CEIL((a.qty * a.harga_satuan) / 10)
							ELSE 0
						END AS besar_ppn, 
						CASE
							WHEN a.pph = 1 THEN CEIL((((a.qty * a.harga_satuan)) * 1.5 / 100))
							ELSE 0
						END AS besar_pph
					FROM
						t_detail_permohonan_dana a	
						LEFT JOIN m_jenis_pajak b ON a.id_jenis_pajak = b.id
						LEFT JOIN m_memiliki_pajak c ON b.id = c.id_jenis_pajak
						LEFT JOIN m_pajak ppn ON c.id_pajak = ppn.id AND ppn.tipe = 'PPN'
						LEFT JOIN m_pajak pph ON c.id_pajak = pph.id AND pph.tipe = 'PPh'
						CROSS JOIN (SELECT @ppn := 0) ppn
					WHERE
						a.id_permohonan_dana = int_id_belanja_barang
				) datanya
			GROUP BY
				datanya.id;

		DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_finished = 1;

		OPEN cursor_data;

		SET dbl_total = 0;
		ulang : LOOP
			FETCH cursor_data INTO dbl_jumlah, dbl_ppn, dbl_pph;

			IF v_finished = 1 THEN 
				LEAVE ulang;
			END IF;
			
			SET dbl_total = (dbl_total + dbl_jumlah + dbl_ppn + dbl_pph);
		END LOOP ulang;

	END;

	# Hitung normatifnya jika dia ada perjalanan dinas
	BEGIN
		DECLARE v_finished INT;
		DECLARE cursor_data CURSOR FOR
			SELECT
				@jumlah_bruto := (a.qty * a.sbu_honor) AS jumlah_bruto
			FROM
				t_detail_permohonan_dana_normatif a
				LEFT JOIN t_pegawai b ON a.id_pegawai = b.id
				LEFT JOIN m_pangkat_pegawai c ON b.id_pangkat = c.id
				LEFT JOIN m_golongan d ON b.id_golongan = d.id
				CROSS JOIN (SELECT @jumlah_bruto := 0) AS jumlah_bruto
				CROSS JOIN (SELECT @pph := 0) AS pph
			WHERE
				a.id_belanja_honor = int_id_belanja_barang
			ORDER BY
				a.id ASC;

		DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_finished = 1;

		OPEN cursor_data;

		ulang : LOOP
			FETCH cursor_data INTO dbl_normatif;

			IF v_finished = 1 THEN 
				LEAVE ulang;
			END IF;
			
			SET dbl_total = dbl_total + dbl_normatif;
		END LOOP ulang;

	END;

	RETURN dbl_total;
END$$

